import React, {Component} from 'react';
import BookCard from 'BookCard';
import PropTypes from 'prop-types';
import './card.css';


class Books extends Component {
  render() {
    return this.props.myBooks.map((book)=>(
      <BookCard myBooks={book}/>
    ));
  }
}

export default Books;
